import React from 'react';
import classes from './Posts.module.css';

export default function Posts(props) {
  const desc = props.post.description;
  return (
    <div className={classes.posts}>
        <img className={classes.image} src={props.post.image} alt="" />
        <p className={classes.price}>{props.post.price}</p>
        <p className={classes.dateOfBuying}>{props.post.dateOfBuying}</p>
        <p className={classes.pro_name}>{props.pro_name}</p>
        <p className={classes.desc}>{desc}</p>
        <p className={classes.Hostel}>{props.hostel}</p>
    </div>
  );
};


Posts.defaultProps ={
    image: "https://cdn.dribbble.com/users/1787778/screenshots/3713333/media/a684905500dc9268e81c03a8a7ad6e09.png?compress=1&resize=800x600&vertical=top",
    price:'₹5,00,000',
    Date_Bought:'March, 2021',
    Product:'Holy-Shit',
    Post_date:'Today',
    Hostel:'Brahmaputra'
};
